import React, { useState, useContext } from 'react'
import axios from "axios";
import AuthContext from "../contexts/AuthContext.jsx";
import {ReactSearchAutocomplete} from "react-search-autocomplete";

const Dashboard = () => {
    const { auth } = useContext(AuthContext);
    const [result, setResult] = useState("");
    const testQuery = () => {
        axios
            .get("http://localhost:5000/resolve/a/www.unipr.it")
            .then((res) => {
                setResult(res.data[0] + " - " + res.data[1]);
            });
    };

    return (
        <>
            <h1>Dashboard page</h1>
            <button onClick={testQuery}>TEST A QUERY</button>
            <div style={{ width: 300, margin: 20 }}>
              <h2>With formatted results!</h2>
              <div style={{ marginBottom: 20 }}>Try to type "JavaScript"</div>
              <ReactSearchAutocomplete
                items={items}
                onSearch={handleOnSearch}
                onHover={handleOnHover}
                onSelect={handleOnSelect}
                onFocus={handleOnFocus}
                onClear={handleOnClear}
                styling={{ zIndex: 1 }}
                formatResult={formatResult}
                autoFocus
              />
              <div style={{ marginTop: 20 }}>This text will be covered!</div>
            </div>
            <p>{result}</p>
        </>
    );
  }

export default Dashboard;
